import React from 'react';
import styled from 'styled-components';

const TimerContainer=styled.section`
background-position: center;
background-size: cover;
width: 100vw;
height: 100vh;

`;
const Timer=styled.section`
background-color: rgba(0,0,0,0.5);
display: flex;
flex: column;
align-items: center;
justify-content: center;
padding-bottom: 7em;
padding-top: 2em;
width: 100%;
height: 100%;


`;

const SectionWrapper=styled.div`
border:
border-radius: 3px;
`;
const Section=styled.section`

`;
const Gap=styled.span``;

const CountDown = () => {
    return (
      <TimerContainer>
          <Timer>
              <SectionWrapper>
              <Section>
                  <p>
                      87
                  </p>
                  <p>
                      <small>
                          Days
                      </small>
                  </p>
                  <Gap></Gap>
              </Section>
              <Section>
                  <p>
                      87
                  </p>
                  <p>
                      <small>
                          Hours
                      </small>
                  </p>
                  <Gap></Gap>
              </Section>
              <Section>
                  <p>
                      87
                  </p>
                  <p>
                      <small>
                          Minutes
                      </small>
                  </p>
                  <Gap></Gap>
              </Section>
              <Section>
                  <p>
                      87
                  </p>
                  <p>
                      <small>
                          Seconds
                      </small>
                  </p>
              </Section>
              </SectionWrapper>
          </Timer>
      </TimerContainer>
    )
}

export default CountDown
